import React from "react";
import Logo from "../img/Logo.png";

function Search() {
  return (
    <div>
      <img src={Logo} style={{ width: "415px", position: "relative" }} />
      <input
        type={"text"}
        style={{
          borderColor: "blue",
          borderRadius: "3px",
          width: "582px",
          height: "52px",
          border: "solid 2px #19ce60",
          marginLeft: "-75px",
          marginTop: "-50px",
          position: "relative",
          fontWeight:"bold",
          fontSize:"18px",
          padding:"13px 15px"
        }}
      />
    </div>
  );
}

export default Search;
